@app.route("/translate/translate", methods=["POST"])
def translate_translate():
  if request.args.get('password') == PASSWORD:
    data = request.get_json()
    toLang = data["toLang"]
    translationType = data["translationType"]

    if translationType == 0:
      result = translate(get_selected_text(), toLang)
      return "<i>Translated from: " + LANGUAGE_MAP.get(result[0], "Unknown Language") + "</i><br><br>" + result[1]
    else:
      pyperclip.copy(translate(get_selected_text(), toLang)[1])
      time.sleep(0.1)
      keyboard.press_and_release('ctrl+v')
  return ""


def translate(text, target_language, source_language="auto"):
  base_url = "https://translate.googleapis.com/translate_a/single"

  encoded_text = urllib.parse.quote(text)

  params = {
    "client": "gtx",
    "sl": source_language,
    "tl": target_language,
    "dt": "t",
    "q": encoded_text,
  }

  url = f"{base_url}?{urllib.parse.urlencode(params)}"

  with urllib.request.urlopen(url) as response:
    result = json.loads(response.read())

  translated_text = ""
  for i in result[0]:
    translated_text += i[0]
  fromLang = result[2]

  translated_text = urllib.parse.unquote(translated_text)
  return [fromLang, translated_text]


def get_selected_text():
  keyboard.press_and_release('ctrl+c')
  time.sleep(0.1) 
  
  selected_text = pyperclip.paste()
  return selected_text


def translateSelected(toLang):
  selected_text = get_selected_text()

  translated = translate(selected_text, target_language=toLang)

  return translated


